// geoprumo/frontend/src/App.jsx

import React, { useState } from 'react';
import Uploader from './components/Upload/Uploader';
import PointsList from './components/Points/PointsList';
import MapView from './components/MapView/MapView';
import ActionPanel from './components/ActionPanel/ActionPanel';
import { optimizeRouteData, enrichRouteWithAI, exportRouteFile } from './services/api';

function App() {
  const [isLoading, setIsLoading] = useState(false);
  const [isEnriching, setIsEnriching] = useState(false);
  const [optimizedData, setOptimizedData] = useState(null);
  const [error, setError] = useState(null);
  const [pendingData, setPendingData] = useState({ files: [], links: [], texts: [] });

  const handleAddData = (payload) => {
    setPendingData(prevData => ({
      files: [...prevData.files, ...payload.files],
      links: [...prevData.links, ...payload.links],
      texts: [...prevData.texts, ...payload.texts],
    }));
  };
  
  // Função ÚNICA de otimização, agora chamada por diferentes botões
  const handleOptimize = async () => {
    const payloadWithExistingPoints = {
      ...pendingData,
      existing_points: optimizedData ? optimizedData.optimized_route : [],
    };
    
    // Verifica se há algo para processar (seja novo ou já existente)
    if (payloadWithExistingPoints.files.length === 0 && payloadWithExistingPoints.links.length === 0 && payloadWithExistingPoints.texts.length === 0 && payloadWithExistingPoints.existing_points.length === 0) {
      setError("Nenhum dado para processar.");
      return;
    }
    
    setIsLoading(true);
    setError(null);
    try {
      const result = await optimizeRouteData(payloadWithExistingPoints);
      setOptimizedData(result);
      setPendingData({ files: [], links: [], texts: [] }); // Limpa a fila após o sucesso
    } catch (err)
     {
      setError(err.message);
    } finally {
      setIsLoading(false);
    }
  };

  const handleEnrich = async () => {
    if (!optimizedData || !optimizedData.optimized_route) return;
    setIsEnriching(true);
    setError(null);
    try {
      const enrichedPoints = await enrichRouteWithAI(optimizedData.optimized_route);
      setOptimizedData(prevData => ({ ...prevData, optimized_route: enrichedPoints }));
    } catch (err) {
      setError(err.message);
    } finally {
      setIsEnriching(false);
    }
  };
  
  const handleExport = async (format) => {
    if (!optimizedData || !optimizedData.optimized_route) return;
    setError(null);
    try {
      await exportRouteFile(format, optimizedData.optimized_route);
    } catch (err) {
      setError(err.message);
    }
  };
  
  const handleReset = () => {
    setOptimizedData(null);
    setPendingData({ files: [], links: [], texts: [] });
    setError(null);
  };
  
  const hasPendingData = pendingData.files.length > 0 || pendingData.links.length > 0 || pendingData.texts.length > 0;
  const hasOptimizedData = optimizedData && optimizedData.optimized_route && optimizedData.optimized_route.length > 0;

  return (
    <div className="bg-gray-100 min-h-screen flex flex-col font-sans">
      <header className="bg-white shadow-md p-4 flex items-center justify-between">
        <div className="flex items-center">
            <img src="/GeoPrumo pin.png" alt="Logo GeoPrumo" className="h-10 w-10 mr-4"/>
            <img src="/GeoPrumo completa.jpg" alt="Logotipo Completo GeoPrumo" className="h-10 hidden sm:block"/>
        </div>
        <button onClick={handleReset} className="bg-gray-200 text-gray-700 font-semibold py-2 px-4 rounded-lg hover:bg-gray-300 text-sm">
            Reiniciar Rota
        </button>
      </header>

      <main className="flex-grow container mx-auto p-4 grid grid-cols-1 lg:grid-cols-2 gap-4">
        <div className="flex flex-col h-[85vh] space-y-4">
          <div className="bg-white p-4 rounded-lg shadow-md">
            <h2 className="text-xl font-bold text-gray-700 mb-2">
              {hasOptimizedData ? 'Adicionar/Otimizar Pontos' : '1. Adicionar Pontos'}
            </h2>
            <Uploader onProcess={handleAddData} isLoading={isLoading} />
            
            {hasPendingData && (
              <div className="mt-4 p-2 bg-gray-50 border rounded">
                <p className="text-sm font-semibold text-gray-600">Novos dados na fila:</p>
                <ul className="text-xs list-disc pl-5 text-gray-500">
                  {pendingData.files.map((f, i) => <li key={`${f.name}-${i}`}>Arquivo: {f.name}</li>)}
                  {pendingData.links.map((l, i) => <li key={`link-${i}`}>Link: {l.substring(0, 40)}...</li>)}
                  {pendingData.texts.map((t, i) => t && <li key={`text-${i}`}>Texto colado</li>)}
                </ul>
              </div>
            )}
            
            {/* Lógica de botões separada e mais clara */}
            <div className="mt-4 grid grid-cols-1 gap-2">
              <button 
                onClick={handleOptimize} 
                disabled={(!hasPendingData && !hasOptimizedData) || isLoading} 
                className="w-full bg-blue-600 text-white font-bold py-2 px-4 rounded-lg hover:bg-blue-700 transition-colors disabled:bg-gray-400 disabled:cursor-not-allowed"
              >
                {isLoading ? 'Processando...' : 'Analisar e Otimizar Rota'}
              </button>
            </div>

            {error && <div className="mt-2 text-red-600 font-bold">{error}</div>}
          </div>
          
          <div className="bg-white p-4 rounded-lg shadow-md flex-grow overflow-y-auto">
            <PointsList 
              route={optimizedData?.optimized_route} 
              onEnrich={handleEnrich}
              isEnriching={isEnriching}
            />
          </div>
          
          {hasOptimizedData && <ActionPanel summary={optimizedData.summary} onExport={handleExport} />}
        </div>

        <div className="bg-white p-4 rounded-lg shadow-md h-[85vh]">
          <MapView data={optimizedData} />
        </div>
      </main>
    </div>
  );
}

export default App;
